import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Box,
  Typography,
  Grid,
  Card,
  CardContent,
  CardActions,
  Button,
  Chip,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  TextField,
  Alert,
  IconButton,
  Tooltip,
} from '@mui/material';
import {
  Add as AddIcon,
  Edit as EditIcon,
  Delete as DeleteIcon,
  Description as DescriptionIcon,
} from '@mui/icons-material';
import axios from 'axios';

const Policies = () => {
  const [policies, setPolicies] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [selectedPolicy, setSelectedPolicy] = useState(null);
  const [cancelDialogOpen, setCancelDialogOpen] = useState(false);
  const [cancelReason, setCancelReason] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    fetchPolicies();
  }, []);

  const fetchPolicies = async () => {
    try {
      setLoading(true);
      const response = await axios.get('/api/policies/user');
      setPolicies(response.data);
    } catch (err) {
      setError('Failed to fetch policies');
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  const handleCancelPolicy = async () => {
    try {
      await axios.post(`/api/policies/${selectedPolicy.id}/cancel`, {
        reason: cancelReason,
      });
      setCancelDialogOpen(false);
      setCancelReason('');
      fetchPolicies();
    } catch (err) {
      setError('Failed to cancel policy');
      console.error(err);
    }
  };

  const getStatusColor = (status) => {
    switch (status.toLowerCase()) {
      case 'active':
        return 'success';
      case 'expired':
        return 'error';
      case 'pending':
        return 'warning';
      default:
        return 'default';
    }
  };

  const formatDate = (dateString) => {
    return new Date(dateString).toLocaleDateString();
  };

  if (loading) {
    return <Typography>Loading...</Typography>;
  }

  if (error) {
    return <Typography color="error">{error}</Typography>;
  }

  return (
    <Box>
      <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 3 }}>
        <Typography variant="h4">My Insurance Policies</Typography>
        <Button
          variant="contained"
          startIcon={<AddIcon />}
          onClick={() => navigate('/new-policy')}
        >
          New Policy
        </Button>
      </Box>

      {error && (
        <Alert severity="error" sx={{ mb: 2 }}>
          {error}
        </Alert>
      )}

      <Grid container spacing={3}>
        {policies.map((policy) => (
          <Grid item xs={12} md={6} lg={4} key={policy.id}>
            <Card>
              <CardContent>
                <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 2 }}>
                  <Typography variant="h6">{policy.type}</Typography>
                  <Chip
                    label={policy.status}
                    color={getStatusColor(policy.status)}
                    size="small"
                  />
                </Box>
                <Typography variant="body2" color="text.secondary" gutterBottom>
                  Policy Number: {policy.policyNumber}
                </Typography>
                <Typography variant="body2" color="text.secondary" gutterBottom>
                  Start Date: {formatDate(policy.startDate)}
                </Typography>
                <Typography variant="body2" color="text.secondary" gutterBottom>
                  Expiry Date: {formatDate(policy.expiryDate)}
                </Typography>
                {policy.coverage && (
                  <Typography variant="body2" color="text.secondary" gutterBottom>
                    Coverage: {policy.coverage}
                  </Typography>
                )}
                {policy.details && (
                  <Typography variant="body2" color="text.secondary">
                    Details: {policy.details}
                  </Typography>
                )}
              </CardContent>
              <CardActions>
                <Tooltip title="View Details">
                  <IconButton size="small">
                    <DescriptionIcon />
                  </IconButton>
                </Tooltip>
                {policy.status === 'active' && (
                  <>
                    <Tooltip title="Edit Policy">
                      <IconButton size="small">
                        <EditIcon />
                      </IconButton>
                    </Tooltip>
                    <Tooltip title="Cancel Policy">
                      <IconButton
                        size="small"
                        color="error"
                        onClick={() => {
                          setSelectedPolicy(policy);
                          setCancelDialogOpen(true);
                        }}
                      >
                        <DeleteIcon />
                      </IconButton>
                    </Tooltip>
                  </>
                )}
              </CardActions>
            </Card>
          </Grid>
        ))}
      </Grid>

      {/* Cancel Policy Dialog */}
      <Dialog open={cancelDialogOpen} onClose={() => setCancelDialogOpen(false)}>
        <DialogTitle>Cancel Policy</DialogTitle>
        <DialogContent>
          <Typography variant="body2" gutterBottom>
            Are you sure you want to cancel this policy? This action cannot be undone.
          </Typography>
          <TextField
            label="Reason for Cancellation"
            value={cancelReason}
            onChange={(e) => setCancelReason(e.target.value)}
            fullWidth
            multiline
            rows={4}
            margin="normal"
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setCancelDialogOpen(false)}>Cancel</Button>
          <Button
            onClick={handleCancelPolicy}
            color="error"
            variant="contained"
            disabled={!cancelReason.trim()}
          >
            Confirm Cancellation
          </Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
};

export default Policies;
